public class NO_028 {
	public static void main(String[] args) {
		String a = new String();
		String b = new String();
		a = "";
		b = "";
		System.out.println(a.length());
		System.out.println(b.length());
		long t1 = System.currentTimeMillis();
		System.out.println(new NO_028().strStr_me(a, b));
		long t2 = System.currentTimeMillis();
		System.out.println(t2-t1);
		String a1 = new String("abc");
		String a2 = new String("aabc");
		System.out.println(new NO_028().strStr(a1, a2));
		long t11 = System.currentTimeMillis();
		System.out.println(new NO_028().strStr(a, b));
		long t22 = System.currentTimeMillis();
		System.out.println(t22-t11);
	}
	
	
	//使用substring和equals方法快得多
	//因为charAt也耗时间
	//相对euqals方法，charAt更耗时
	public int strStr(String haystack, String needle) {
		if("".equals(needle))
			return 0;
		for(int i = 0; i < haystack.length(); i++){
			if(haystack.length()-i >= needle.length() && haystack.substring(i, i+needle.length()).equals(needle))
				return i;
		}
		return -1;
    }
	
	//超时
	public int strStr_me(String haystack, String needle) {
		for(int i = 0; i < haystack.length(); i++){
			boolean state = true;
			for(int j = 0; j < needle.length(); j++){
				if(i+j < haystack.length() && needle.charAt(j) == haystack.charAt(i+j))
					continue;
				else{
					state = false;
					break;
				}
			}
			if(state)
				return i;
		}
		return -1;
    }
}
